create table Customer (
	id INT PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	telephone_Number VARCHAR(50)
);

SELECT * FROM Customer;

SELECT id, first_name,last_name, telephone_Number
FROM Customer
WHERE last_name = 'Noweak';

-- Show the Query Plan for the SQL Statement
EXPLAIN
SELECT id, first_name,last_name, telephone_Number
FROM Customer
WHERE last_name = 'Noweak';

-- A simple version of CREATE INDEX statement is as follows:
CREATE INDEX index_name ON table_name [USING method]
(
    column_name [ASC | DESC] [NULLS {FIRST | LAST }],
    ...
);

-- First, specify the index name after the CREATE INDEX clause.
-- The index name should be meaningful and easy to remember.
-- Second, specify the name of the table to which the index belongs.
-- Third, specify the index method such as btree, hash, gist, spgist, gin, and brin.
-- PostgreSQL uses btree by default.
-- Fourth, list one or more columns that to be stored in the index.
-- The ASC and DESC specify the sort order. ASC is the default.
-- NULLS FIRST or NULLS LAST specifies nulls sort before or after non-nulls.
-- The NULLS FIRST is the default when DESC is specified and NULLS LAST is the
-- default when DESC is not specified.

-- To improve this query, you can define an
-- index expression like this:
CREATE INDEX idx_ic_last_name
ON Customer(LOWER(last_name));

SELECT id, first_name,last_name, telephone_Number
FROM Customer
WHERE LOWER(last_name) = 'noweak';

-- To check if a query uses an index or not, you use the EXPLAIN statement.
EXPLAIN
SELECT id, first_name,last_name, telephone_Number
FROM Customer
WHERE LOWER(last_name) = 'noweak';

-- PostgreSQL server provides following types of indexes, which each uses a different algorithm:
-- B-tree (default), Hash, GiST, SP-GiST, GIN, BRIN

DROP INDEX idx_ic_last_name;
